const Post = (user, title, text) => {
    useEffect(() => {
        user = user;
        title = title;
        text = text;
    }, []);

    return (
        <div>
            <p>{user}</p>
            <h4>{title}</h4>
            <p>{text}</p>
        </div>
    )
}

export default Post;
